import React, { useEffect, useState } from 'react';
import { BrowserRouter, Routes, Route, Link, Navigate, useNavigate } from 'react-router-dom';
import { isAuthenticated, logout, getUserData } from './utils/auth';

// Import all components
import HomePage from './components/HomePage';
import LoginPage from './components/LoginPage';
import RegisterPage from './components/RegisterPage';
import Dashboard from './components/Dashboard';
import ClubDetails from './components/ClubDetails';
import CreateClub from './components/CreateClub';

// ProtectedRoute component
const ProtectedRoute = ({ children }) => {
  return isAuthenticated() ? children : <Navigate to="/login" replace />;
};

const App = () => {
  const [user, setUser] = useState(null);

  useEffect(() => {
    // Check if user is authenticated and set user data
    if (isAuthenticated()) {
      const userData = getUserData();
      setUser(userData);
    }
  }, []);

  const handleLogout = () => {
    logout();
    setUser(null);
    window.location.href = '/login';
  };

  return (
    <BrowserRouter>
      <div className="flex flex-col min-h-screen bg-gray-900">
        {/* Navigation Header */}
        <header className="bg-gray-800 border-b border-gray-700">
          <div className="container mx-auto px-4 py-3 flex justify-between items-center">
            <Link to="/" className="text-2xl font-bold text-white">
              Sports<span className="text-blue-500">Community</span>
            </Link>
            <nav className="flex space-x-6">
              <Link to="/" className="text-gray-300 hover:text-white">Home</Link>
              {isAuthenticated() ? (
                <>
                  <Link to="/dashboard" className="text-gray-300 hover:text-white">Dashboard</Link>
                  <button 
                    onClick={handleLogout} 
                    className="text-gray-300 hover:text-white"
                  >
                    Logout
                    {user && user.username && <span className="ml-1 text-xs">({user.username})</span>}
                  </button>
                </>
              ) : (
                <>
                  <Link to="/login" className="text-gray-300 hover:text-white">Login</Link>
                  <Link to="/register" className="text-gray-300 hover:text-white">Register</Link>
                </>
              )}
            </nav>
          </div>
        </header>

        {/* Main Content */}
        <main className="flex-grow">
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/login" element={
              isAuthenticated() ? <Navigate to="/dashboard" replace /> : <LoginPage />
            } />
            <Route path="/register" element={
              isAuthenticated() ? <Navigate to="/dashboard" replace /> : <RegisterPage />
            } />
            <Route path="/clubs/:id" element={<ClubDetails />} />
            <Route path="/dashboard" element={
              <ProtectedRoute>
                <Dashboard />
              </ProtectedRoute>
            } />
            <Route path="/create-club" element={
              <ProtectedRoute>
                <CreateClub />
              </ProtectedRoute>
            } />
            {/* Catch-all route - redirect to home */}
            <Route path="*" element={<Navigate to="/" replace />} />
          </Routes>
        </main>

        {/* Footer */}
        <footer className="bg-gray-800 border-t border-gray-700 py-4 text-center text-gray-400">
          <div className="container mx-auto">
            <p>© {new Date().getFullYear()} Sports Community. All rights reserved.</p>
          </div>
        </footer>
      </div>
    </BrowserRouter>
  );
};

export default App;
